        function decrypt() {
            var pass = document.getElementById('p').value;
            try {
                var decrypted = CryptoJS.AES.decrypt(content, pass).toString(CryptoJS.enc.Utf8);

                    document.open();
                    document.write(decrypted);
                    document.close();

                document.getElementById('p').value = '';
